import React from "react";
import ForcastCard from "components/ForcastCard";
const DailyForcast = (props) => {
  const { daily } = props;
  return (
    <ul>
      {daily.data.map((key, item) => (
        <li key={key}>
          <ForcastCard type="daily" highTemp={item.temperatureHigh} lowTemp={item.temperatureLow} icon={item.icon} title={item.time} />
        </li>
      ))}
    </ul>
  );
};
export default DailyForcast;
